import React, { Component } from 'react'; 
import './App.css';

// Function that displays the heading message 
class Welcome extends React.Component{
  render(){
    // Variables that will be used for the heading of the web app
    const title = 'Juan\'s To-Do List';
    let date = new Date().toLocaleDateString();

    // Display the heading
    return(
      <div className ="Heading">
        <h1>{title}</h1>
        <h2>Today's date is {date}</h2>
      </div>
    );
  }
}
export default App;
